import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import { GOOGLE_MAPS_API_KEY } from '../../config/maps';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './priceprediction.css';

const GOOGLE_MAPS_LIBRARIES = ['places', 'geometry'];

function loadGoogleMaps(apiKey) {
  if (!apiKey) {
    return Promise.reject(new Error('Missing Google Maps API key (set in src/config/maps.js or .env)'));
  }
  if (window.google && window.google.maps) {
    return Promise.resolve(window.google);
  }
  if (window._googleMapsPromise) {
    return window._googleMapsPromise;
  }
  const script = document.createElement('script');
  const libs = GOOGLE_MAPS_LIBRARIES.join(',');
  script.src = `https://maps.googleapis.com/maps/api/js?key=${apiKey}&libraries=${libs}`;
  script.async = true;
  script.defer = true;
  window._googleMapsPromise = new Promise((resolve, reject) => {
    script.onload = () => resolve(window.google);
    script.onerror = reject;
  });
  document.head.appendChild(script);
  return window._googleMapsPromise;
}

const DEFAULT_CENTER = { lat: 1.2868108, lng: 103.8545349 }; // SG center-ish
const SEARCH_RADIUS_METERS = 1000;

const PricePrediction = () => {
  const [activeTab, setActiveTab] = useState('price-prediction');
  const [formData, setFormData] = useState({
    propertyType: '',
    address: '',
    floorArea: '',
    level: '',
    unit: ''
  });
  const [searchAddress, setSearchAddress] = useState('');
  const [clickedAddress, setClickedAddress] = useState('');
  const [isSearching, setIsSearching] = useState(false);
  const [searchError, setSearchError] = useState('');
  const navigate = useNavigate();

  const markerRef = useRef(null);
  const mapInstanceRef = useRef(null);
  const geocoderRef = useRef(null);
  const autocompleteRef = useRef(null);
  const inputRef = useRef(null);
  const lastLocationRef = useRef(null);

  // Get user type from localStorage
  const userType = localStorage.getItem('userType') || 'free';

  const navigationItems = [
    { id: 'dashboard', label: 'Dashboard', icon: 'üè†' },
    { id: 'price-prediction', label: 'Price Prediction', icon: 'üìà' },
    ...(userType === 'premium' ? [{ id: 'compare-predictions', label: 'Compare Predictions', icon: 'üîÑ' }] : []),
    { id: 'bookmarks', label: 'Bookmarks', icon: 'üîñ' },
    { id: 'support', label: 'Support', icon: '‚ùì' },
    { id: 'feedback', label: 'Feedback', icon: 'üí¨' },
    { id: 'profile', label: 'Profile', icon: 'üë§' }
  ];

  const propertyTypes = [
    'Industrial Property',
    'Commercial Space',
    'Warehouse',
    'Office Space',
    'Retail Unit',
    'Factory Building'
  ];

  const levels = [
    'Ground Floor',
    'Level 1',
    'Level 2',
    'Level 3',
    'Level 4',
    'Level 5+'
  ];

  const recentSearches = [
    {
      id: 1,
      propertyType: 'Industrial Property',
      address: '123 Main Street, Singapore'
    },
    {
      id: 2,
      propertyType: 'Commercial Space',
      address: '456 Oak Avenue, Singapore'
    },
    {
      id: 3,
      propertyType: 'Warehouse',
      address: '789 Pine Lane, Singapore'
    }
  ];

  // Initialize Google Maps
  useEffect(() => {
    loadGoogleMaps(GOOGLE_MAPS_API_KEY)
      .then((google) => {
        const mapDiv = document.getElementById('price-prediction-map');
        if (!mapDiv) {
          console.error('Map div not found');
          return;
        }
        const map = new google.maps.Map(mapDiv, {
          center: DEFAULT_CENTER,
          zoom: 16,
          mapTypeControl: false,
          streetViewControl: false,
          fullscreenControl: true,
        });
        mapInstanceRef.current = map;
        geocoderRef.current = new google.maps.Geocoder();

        // Map click -> reverse geocode + marker
        map.addListener('click', (e) => {
          const latLng = e.latLng;
          placeMarker(latLng);
          reverseGeocode(latLng);
        });

        // Autocomplete on input
        if (inputRef.current) {
          const autocomplete = new google.maps.places.Autocomplete(inputRef.current, {
            componentRestrictions: { country: 'sg' },
            fields: ['geometry', 'formatted_address', 'name'],
          });
          autocompleteRef.current = autocomplete;
          autocomplete.addListener('place_changed', () => {
            const place = autocomplete.getPlace();
            if (!place || !place.geometry || !place.geometry.location) return;
            
            const latLng = place.geometry.location;
            map.panTo(latLng);
            map.setZoom(18);
            placeMarker(latLng);
            const address = place.formatted_address || place.name || '';
            setClickedAddress(address);
            setSearchAddress(address);
            setFormData(prev => ({ ...prev, address: address }));
            setSearchError('');
          });
        }
      })
      .catch((err) => {
        console.error('Error loading Google Maps:', err);
        setSearchError('Map failed to load. Please configure your Google Maps API key in src/config/maps.js or .env');
      });
  }, []);

  const placeMarker = (latLng) => {
    const google = window.google;
    if (!google || !mapInstanceRef.current) return;
    if (markerRef.current) {
      markerRef.current.setMap(null);
      markerRef.current = null;
    }
    const marker = new google.maps.Marker({
      position: latLng,
      map: mapInstanceRef.current,
      animation: google.maps.Animation.DROP,
    });
    markerRef.current = marker;
    lastLocationRef.current = latLng;
  };

  const reverseGeocode = (latLng) => {
    const geocoder = geocoderRef.current;
    if (!geocoder) return;
    geocoder.geocode({ location: latLng }, (results, status) => {
      if (status === 'OK' && results && results.length) {
        const result = results[0];
        const address = result.formatted_address;
        
        setClickedAddress(address);
        setSearchAddress(address);
        setFormData(prev => ({ ...prev, address: address }));
        setSearchError('');
        if (markerRef.current) {
          const infowindow = new window.google.maps.InfoWindow({
            content: `<div style="font-weight:600">${address}</div>`,
          });
          infowindow.open({ anchor: markerRef.current, map: mapInstanceRef.current });
        }
      }
    });
  };

  const handleSearchAddress = async () => {
    setSearchError('');
    const google = window.google;
    if (!google || !mapInstanceRef.current) {
      setSearchError('Map not ready. Please wait a moment and try again.');
      return;
    }
    if (!searchAddress.trim()) return;
    setIsSearching(true);
    try {
      const geocoder = geocoderRef.current || new google.maps.Geocoder();
      geocoderRef.current = geocoder;
      
      // Check if input is a postal code (6 digits)
      const isPostalCode = /^\d{6}$/.test(searchAddress.trim());
      const searchQuery = isPostalCode ? `${searchAddress}, Singapore` : `${searchAddress}, Singapore`;
      
      geocoder.geocode({ address: searchQuery }, (results, status) => {
        if (status === 'OK' && results && results.length) {
          const result = results[0];
          const latLng = result.geometry.location;
          
          mapInstanceRef.current.panTo(latLng);
          mapInstanceRef.current.setZoom(18);
          placeMarker(latLng);
          const address = result.formatted_address;
          setClickedAddress(address);
          setSearchAddress(address);
          setFormData(prev => ({ ...prev, address: address }));
          
          // Show success message for postal code
          if (isPostalCode) {
            console.log(`‚úÖ Found address for postal code ${searchAddress}: ${address}`);
          }
        } else {
          if (isPostalCode) {
            setSearchError('No results found for this postal code. Please check the postal code.');
          } else {
            setSearchError('No results found for this address.');
          }
        }
        setIsSearching(false);
      });
    } catch (err) {
      setSearchError('Error searching address.');
      setIsSearching(false);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleSearchAddress();
    }
  };



  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = (e) => {
    e.preventDefault();
    // Navigate to prediction results page with search data
    const searchData = {
      address: formData.address,
      propertyType: formData.propertyType,
      floorArea: formData.floorArea,
      level: formData.level,
      unit: formData.unit
    };
    navigate('/dashboard/prediction', { state: { searchData } });
  };

  const handleRecentSearchClick = (search) => {
    setFormData({
      propertyType: search.propertyType,
      address: search.address,
      floorArea: '',
      level: '',
      unit: ''
    });
    setSearchAddress(search.address);
    setClickedAddress(search.address);
  };

  const handleNavigation = (itemId) => {
    setActiveTab(itemId);
    
    // Navigate to different pages based on the selected item
    switch (itemId) {
      case 'dashboard':
        navigate('/dashboard/free');
        break;
      case 'price-prediction':
        // Already on price prediction page, no navigation needed
        break;
      case 'bookmarks':
        navigate('/bookmarks');
        break;
      case 'support':
        navigate('/support');
        break;
      case 'feedback':
        navigate('/feedback');
        break;
      case 'profile':
        navigate('/profile');
        break;
      default:
        break;
    }
  };

  // Add click listener to close dropdown when clicking outside
  useEffect(() => {
    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, []);

  return (
    <div className="price-prediction-dashboard">
      {/* Top Header */}
      <Header />

      <div className="dashboard-container">
        {/* Left Sidebar */}
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />

        {/* Main Content */}
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">Get Sales Price Prediction</h1>
          </div>

          <div className="search-section">
            <form onSubmit={handleSearch} className="search-form">
              <div className="form-group">
                <label htmlFor="propertyType">Property Type</label>
                <select
                  id="propertyType"
                  name="propertyType"
                  value={formData.propertyType}
                  onChange={handleInputChange}
                  required
                >
                  <option value="">Select property type</option>
                  {propertyTypes.map((type, index) => (
                    <option key={index} value={type}>{type}</option>
                  ))}
                </select>
              </div>

                             <div className="form-group">
                 <label htmlFor="address">Address or Postal Code</label>
                 <div className="address-search-container">
                   <input
                     ref={inputRef}
                     type="text"
                     id="address"
                     name="address"
                     value={searchAddress}
                     onChange={(e) => {
                       setSearchAddress(e.target.value);
                       setFormData(prev => ({ ...prev, address: e.target.value }));
                       if (e.target.value === '') {
                         setSearchError('');
                         setClickedAddress('');
                         if (markerRef.current) {
                           markerRef.current.setMap(null);
                           markerRef.current = null;
                         }
                       }
                     }}
                     onKeyPress={handleKeyPress}
                     placeholder="Search for address or enter 6-digit postal code"
                     disabled={isSearching}
                     required
                   />
                   <button 
                     type="button"
                     className="address-search-btn" 
                     onClick={handleSearchAddress}
                     disabled={isSearching || !searchAddress.trim()}
                   >
                     {isSearching ? 'Searching...' : 'Search'}
                   </button>
                 </div>
                 {searchError && (
                   <div className="search-error">{searchError}</div>
                 )}
                 <div className="search-hint">
                   <small>üí° You can search by address or enter a 6-digit Singapore postal code</small>
                 </div>
               </div>

              <div className="map-snippet">
                <div id="price-prediction-map" className="map-container"></div>
                                 <div className="map-instructions">
                   <p>üß≠ <strong>Location Selection</strong></p>
                   <p>Click the map or use search to pick a location.</p>
                   <p><small>You can search by address or postal code. The selected address will be automatically filled in the form above.</small></p>
                 </div>
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label htmlFor="floorArea">Floor Area (sq ft)</label>
                  <input
                    type="number"
                    id="floorArea"
                    name="floorArea"
                    value={formData.floorArea}
                    onChange={handleInputChange}
                    placeholder="Enter floor area"
                    required
                  />
                </div>

                <div className="form-group">
                  <label htmlFor="level">Level</label>
                  <select
                    id="level"
                    name="level"
                    value={formData.level}
                    onChange={handleInputChange}
                    required
                  >
                    <option value="">Select level</option>
                    {levels.map((level, index) => (
                      <option key={index} value={level}>{level}</option>
                    ))}
                  </select>
                </div>

                <div className="form-group">
                  <label htmlFor="unit">Unit</label>
                  <input
                    type="text"
                    id="unit"
                    name="unit"
                    value={formData.unit}
                    onChange={handleInputChange}
                    placeholder="Enter unit number"
                    required
                  />
                </div>
              </div>

              <button type="submit" className="search-btn">
                Search
              </button>
            </form>
          </div>
        </main>

        {/* Right Sidebar - Recent Searches */}
        <aside className="recent-searches-sidebar">
          <h2 className="sidebar-title">Recent Searches</h2>
          <div className="recent-searches-list">
            {recentSearches.map((search) => (
              <div 
                key={search.id} 
                className="recent-search-item"
                onClick={() => handleRecentSearchClick(search)}
              >
                <span className="search-icon">üîç</span>
                <div className="search-details">
                  <div className="search-property-type">{search.propertyType}</div>
                  <div className="search-address">{search.address}</div>
                </div>
              </div>
            ))}
          </div>
        </aside>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default PricePrediction;
